.text
main:

prompt_user:
	move $t0, $zero		#clear out $t0
	la $a0, prompt		#ask user if ready to begin, load address of prompt string
	li $v0, 4		#syscall for print strings
	syscall
	
	#for integer input only, if any other char is entered, program crashes...
	#string input is more dangerous (but more user friendly), so I opted for that instead
	#li $v0, 5
	#syscall
	
	#for string input
	li $v0, 8		#syscall for string input
	la $a0, input		#address of input buffer
	li $a1, 4
	#la $a1, input		#will keep reading characters in, but moves address of input around
	syscall
	
	#save value entered to register $s0 to compare (if doing integer input only)
	#value gets saved to $v0
	#move $t0, $v0
	
	lw $t0, input		#set $t0 to contents of memory word at "input's" address
	#if input equal to 0, begin test
	#ascii hex for "0" is 30, but an "a" is being added before
	#so testing for equality to 0x00000a30, which is 2608 in decimal
	#weird, but no time to track down why an "a" is being added before
	beq $t0, 2608, begin_test
	
	#else keep asking user if ready
	la $a0, response	#ask user if ready to begin, load address of prompt string
	li $v0, 4		#syscall for print strings
	syscall
	b prompt_user		#return to initial user prompt
	
begin_test:
	la $a0, begin		#ask user if ready to begin, load address of prompt string
	li $v0, 4		#syscall for print strings
	syscall
	
	li $t0, 5000   		#load loop counter $t0
	li $t1, 1    		#set what we subtract by (1)
	li $t2, 0    		#set comparator to 0, just to be safe
	
	#setting RNG seed
	li $v0, 40
	syscall
	
	#setting up random addition value
	#li $a1, 100000		#setting to a max bound, safely can use this
				#without chance of overflow ( (100,000 * 104) < (147483647) )
	#li $v0, 42		#generate pseudo random number
	#syscall			#doing the syscall
	#move $s0, $a0		#storing it in $s0
	
	repeat:
	#setting up random addition value
	#li $a1, 1		#setting to a max bound, 1 in this case
	#li $v0, 42		#generate pseudo random number
	#syscall			#doing the syscall
	#move $s0, $a0		#storing it in $s0, to use for branch condition later
	
	sub $t3, $t0, $t1   	#subtract $t0 by 1 and put result in $t3
	move $t0, $t3       	#move what's in $t3 to $t0
	beq $t3, $t2, end   	#branch if t3 equal to 0, to end
	li $a1, 4194304  	#set $a1 to the max bound (max of 4MB per mem. section, doing 2MB to be safe)
	li $v0, 42  		#generate the pseudo random number
	syscall     		#doing the syscall
	#saving value to $s0
	move $s0, $a0
	
	####If you want to print to I/O screen instead
	#value from 1 sample of random number generator above will already be in $a0
	#so we can just call the "print integer" syscall, shows user some of the numbers
	li $v0, 1   		#print integer to "RUN I/O" screen
	syscall     		#syscall again
	
	#0x004FFFFF -> fetch address not aligned on word boundary
	andi $s0, $s0, 0x1001FFFF	#masking for the .data section starting at 0x10010000, will go out of bounds otherwise
	#have to load byte, otherwise run into alignment errors (when using load word)
	lb $s1, random+0($s0)		#loading in random address to $s1
	#sb $s1, random+0($s0)		#
	
	#Need 2 numbers, a random number to write, and a random address (an offset) to go to
	#gettin the random number to write first
	li $a1, 2147483647	#setting random number to a max bound (can be signed int max because it's data written to an address)
	li $v0, 42		#generate pseudo random number
	syscall			#doing the syscall
	move $s2, $a0		#storing it in $s0, to use for branch condition later
	
	#now generating the random number for the address in "random's" allocated memory
	li $a1, 4194304		#setting random number to a max bound (was 1000)
	li $v0, 42		#generate pseudo random number
	syscall			#doing the syscall
	move $s3, $a0		#storing it in $s0, to use for branch condition later
	andi $s3, $s3, 0x1001FFFF	#masking for the .data section starting at 0x10010000, will go out of bounds otherwise
	sb $s2, random+0($s3)
	#sw $s1, 0($s2)		#not aligned, writes to .text memory section
	
	#additional memory writing, going to use all the $s registers
	#this number will be used as a random branching condition
	#if zero: branch, if not: don't
	
	##li $a1, 1		#setting random number to a max bound
	##li $v0, 42		#generate pseudo random number
	##syscall			#doing the syscall
	##move $s4, $a0		#storing it in $s0, to use for branch condition later
	##beq $s4, $zero, binary_random	#if equal to zero, branch
	#otherwise, go here
	#load in 1st address of random[]
		#andi $s5, $s5, 0x00000000	#clear out $s5
	##sb $s4, random($s4)
	##addi $t4, $t4, 1
	
#binary_random:
	#load in a high address of random
	
	##sb $s4, random+100000($s4)
	##addi $t5, $t5, 1  #counter
	
	
	
	
	
	#filling up the rest of the S registers with pseudo random number
	#li $a1, 2147483647	#setting to a max bound, (32 bit signed MAX)
	#li $v0, 42		#generate pseudo random number
	#syscall			#doing the syscall
	#move $s2, $a0		#storing it in $s0
	
	#storing it to all the vars
	#sw $s2, var1
	
	#filling up the rest of the T registers with pseudo random number
	#move $t4, $s1
	#move $t5, $s1
	#move $t6, $s1
	#move $t7, $s1
	#move $t8, $s1
	#move $t9, $s1
	
	
	########################
	##save off if you want to write it to a file later
	#move $s0, $a0		#save off random num to save point
	##move it to temp_arr space
	#sw $s0, temp_arr
	########################
	
	########################
	##Opening a file
	#li $v0, 13		#syscall num for opening a file
	#la $a0, filename	#putting out filename
	##li $a1, 1		#open file for writing
	#li $a1, 9		#open file for writing with append
	#li $a2, 0		#ignore mode
	#syscall			#open the file
	#move $s6, $v0		#save file descriptor
	########################
	
	
	
	
	
	#want a new line character
	#need to clear $a0 now, going to use $zero register
	#(move ($a0) <-- ($zero)
	move $a0, $zero
	#load up ascii code for LF (new line, integer 10)
	#makes output in "Run I/O" section
	addi $a0, $zero, 10
	li $v0, 11		#syscall number for printing character
	syscall
	
	########################
	##If you want to send something to a file
	#li $v0, 15		#syscall for writing to file
	#move $a0, $s6		#restoring file descriptor
	##below doesn't work! loads value not address
	#la $a1, ($s0)		#load address of output buffer
	#la $a1, temp_arr
	#li $a2, 12		#size of buffer
	#FIXME: runtime exception at 0x00400054: address out of range
	#syscall			#syscall to write to file
	########################
	
	########################
	#Let's play some music (some other time)
	#li $v0, 31		#syscall for MIDI out
	#li $a0, 75		#pitch value from 0-127
	#li $a1, 3000		#duration in milliseconds
	#li $a2, 7		#instrument (0-127), 7 is a guitar
	#li $a3, 100		#volume from 0-127
	#syscall
	########################
	
	########################
	##close file
	#li $v0, 16		#syscall to close file
	#move $a0, $s6		#file descriptor to close
	#syscall			#close file
	########################
	
	b repeat    		#always branch back to repeat here
	end:       		#end of pseudo random number generation
	
	#close file
	#li $v0, 16		#syscall to close file
	#move $a0, $s6		#file descriptor to close
	#syscall		#close file
	
	#exit program
	li $v0, 10
	syscall
